script: |
  super -f text -I q2062.spq | sort > q2062.out

inputs:
  - name: q2062.spq
    data: |
      SELECT DISTINCT - col1 - col1 FROM tab1 (FORMAT parquet) WHERE NOT + col2 * + + col0 IN ( - ( col1 ) * 17 + - col0 / - col2 * - + 71 * + 26 + + + col0, + ( + + col0 ) * col0 + + 71, col2 * - col1 * - + 74, 76 );
  - name: tab1

outputs:
  - name: q2062.out
    data: |
      -10
      -28
      -94
